import Link from 'next/link';


const Navbar = () => (

    
        <ul>
             <li><Link href = "/"> <text> Home </text> </Link> </li>
            <li><Link href = "/about"> <text> about </text> </Link> </li>
            
        </ul>

    

);

export default Navbar;
